import React from 'react'
import '../Styles/Table-Styles.css'
import axios from 'axios';


export class Table extends React.Component {
    constructor(props) {
       super(props)
       this.state = {
          instances: []
       }
    }
    // componentDidMount () {
    //     axios.get(`http://localhost:8080/?region=us-east-2`)
    //       .then(res => {


    //         const instances = res.data;
    //         this.setState({ instances : instances });   
    //       }).catch(err => console.log(err))
    //   }


    renderTableHeader () {
       let header = Object.keys(this.props.instances[0])
       return header.map((key, index) => {
          return <th key={index}>{key.toUpperCase()}</th>
       })
    }


    render() {
        console.log(Object.keys(this.state.instances))
       return (
          <div className="table-container">
             <h1 id='title'>AWS EC2 Instances</h1>
             <table id='instances'>
                <tbody>
                   <tr>{Object.keys(this.props.instances).map((key, index) => {
                            return <th key={index}>{key.toUpperCase()}</th>
                        })}</tr>
                   {this.props.instances.map((instance, index) => {
                        return (
                            <tr key={instance.InstanceID}>
                                <td>{instance.InstanceID}</td>
                                <td>{instance.ImageID}</td>
                                <td>{instance.InstanceType}</td>
                                <td>{instance.AvailabilityZone}</td>
                                <td>{instance.State}</td>
                            </tr>
                        );
                })}
                </tbody>
             </table>
          </div>
       )
    }
 }
